import { StatusBar } from 'expo-status-bar';
import { Button, StyleSheet, Text, View, Bu } from 'react-native';
import { NavigationContainer, useNavigation } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

function TelaInicial(){
  const navigation = useNavigation();
  return (

      <View style={styles.container}>
      <Text>Teste do React Native Meu Mano</Text>
      <Button title='CADASTRAR' onPress={() => {console.log("Apertou o botão :p"); }} ></Button>
       navigation.navigate('Cadastro')
      <StatusBar style="auto"/>
      </View>
    );
} 

 export default function App() {
  const Stack = createNativeStackNavigator();
    return(
      <NavigationContainer> 
        <Stack.Navigator>
          <Stack.Screen name="Início" component={TelaInicial} />
          <Stack.Screen name="Cadastro" component={TelaCadastro} />
        </Stack.Navigator>
      </NavigationContainer>

    );
 }

 function TelaCadastro(){

  return (
     <View style={styles.container}>
      <Text>Seu cadastro está aqui meu amigo(a)</Text>
      <Button title='VOLTAR' onPress={() => {console.log("Apertou o botão VOLTAR :p"); }} ></Button>
     navigation.navigate('Início')
      <StatusBar style="auto"/>
      </View>
    );
} 

  const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
